import React, { useState, useEffect } from "react";

const TouristDetails = ({ tourist }) => {
  const [email, setEmail] = useState("");
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");
  const [mobileNumber, setMobileNumber] = useState("");
  const [nationality, setNationality] = useState("");
  const [dob, setDob] = useState("");
  const [status, setStatus] = useState("");
  const [wallet, setWallet] = useState(0);
  const [errorMessage, setErrorMessage] = useState("");

  // Use useEffect to initialize state with tourist data if provided
  useEffect(() => {
    if (tourist) {
      setEmail(tourist.email || "");
      setUsername(tourist.username || "");
      setPassword(tourist.password || ""); // Password might not be populated for security
      setMobileNumber(tourist.mobileNumber || "");
      setNationality(tourist.nationality || "");
      setDob(tourist.dob || "");
      setStatus(tourist.status || "");
      setWallet(tourist.wallet || 0);
    }
  }, [tourist]);

  const handleSubmit = (e) => {
    e.preventDefault();

    // Perform validations here based on requirements
    if (!/.+@.+\..+/.test(email)) {
      setErrorMessage("Please enter a valid email address");
      return;
    }
    if (username.length < 3 || username.length > 20) {
      setErrorMessage("Username must be between 3 and 20 characters");
      return;
    }
    if (password.length < 8) {
      setErrorMessage("Password must be at least 8 characters");
      return;
    }
    if (!/^\+?[0-9]{10,15}$/.test(mobileNumber)) {
      setErrorMessage("Please enter a valid mobile number");
      return;
    }
    if (!nationality) {
      setErrorMessage("Nationality is required");
      return;
    }
    if (!dob) {
      setErrorMessage("Date of birth is required");
      return;
    }

    const birthDate = new Date(dob);
    const today = new Date();
    let age = today.getFullYear() - birthDate.getFullYear();
    const monthDiff = today.getMonth() - birthDate.getMonth();
    if (
      monthDiff < 0 ||
      (monthDiff === 0 && today.getDate() < birthDate.getDate())
    ) {
      age--;
    }
    if (age < 18) {
      setErrorMessage("You must be at least 18 years old.");
      return;
    }
    if (!status) {
      setErrorMessage("Status is required");
      return;
    }

    // If everything is valid, you can handle submission logic here
    console.log({
      email,
      username,
      password,
      mobileNumber,
      nationality,
      dob,
      status,
      wallet,
    });

    setErrorMessage(""); // Clear error message on successful submission
  };

  return (
    <div>
      <h2>Tourist Details</h2>
      {errorMessage && <p style={{ color: "red" }}>{errorMessage}</p>}
      <form onSubmit={handleSubmit}>
        <div>
          <label>Email:</label>
          <input
            type="email"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            required
          />
        </div>
        <div>
          <label>Username:</label>
          <input
            type="text"
            value={username}
            onChange={(e) => setUsername(e.target.value)}
            required
            minLength="3"
            maxLength="20"
          />
        </div>
        <div>
          <label>Password:</label>
          <input
            type="password"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
            required
            minLength="8"
          />
        </div>
        <div>
          <label>Mobile Number:</label>
          <input
            type="text"
            value={mobileNumber}
            onChange={(e) => setMobileNumber(e.target.value)}
            required
            pattern="^\+?[0-9]{10,15}$"
          />
        </div>
        <div>
          <label>Nationality:</label>
          <input
            type="text"
            value={nationality}
            onChange={(e) => setNationality(e.target.value)}
            required
          />
        </div>
        <div>
          <label>Date of Birth:</label>
          <input
            type="date"
            value={dob}
            onChange={(e) => setDob(e.target.value)}
            required
          />
        </div>
        <div>
          <label>Status:</label>
          <select
            value={status}
            onChange={(e) => setStatus(e.target.value)}
            required
          >
            <option value="">Select Status</option>
            <option value="job">Job</option>
            <option value="student">Student</option>
          </select>
        </div>
        <div>
          <label>Wallet:</label>
          <input
            type="number"
            value={wallet}
            onChange={(e) => setWallet(e.target.value)}
            min="0"
          />
        </div>
        <button type="submit">Submit</button>
      </form>
    </div>
  );
};

export default TouristDetails;
